import React from 'react';
import { Layout, theme } from 'antd';
import { Route, BrowserRouter as Router, Switch, createBrowserRouter } from 'react-router-dom';
import Main from './pages/Main';


const App: React.FC = () => {
  const router = createBrowserRouter([
    { path: '/', element: <Main /> },
    { path: '/:id', element: <Main />}
  ]);

  return (
   <Router>
    <Switch>
      <Route path='/' Component={Main}/>

    </Switch>
   </Router>
  );
};

export default App;
